import React, {Component, useState, useContext, useEffect} from 'react';
import {
  View,
  Dimensions,
  Modal, 
  Text,
  Pressable,
  Linking,
  ScrollView,
  Image,
  StyleSheet,
  TouchableOpacity
} from 'react-native'
import {Context as AuthContext} from '../context/AuthContext';
import Modell from './Modell';

export default class Header extends React.Component { 
  constructor(props) {
    super(props);
  } 

  render() { 
    return (
      <View  style={styles.temT}>
        <TouchableOpacity style={styles.image1} onPress={this.props.onPress}>
          <Image source={require('../images/menu1.png')} />
        </TouchableOpacity> 
        <Image source={require('../images/icone.png')} style={styles.imagei}/>
        <Text style={styles.temText}>AGROTECH SMART IRRIGATION APP</Text>
        <Modell/>
      </View>
    );  
  }
} 

const styles = StyleSheet.create({
  temT: {
    marginTop:"7%",
    alignSelf:"center",
    flexDirection: 'row',
    alignContent:'center',
  },
  image1:{
    marginLeft:"5%",
    marginRight:"3%"
  },
  temText: {
    fontSize:16,
    textAlign:"center",
    color:'#FFFFFF',
    marginBottom:"2%",
    fontFamily:'adobe-arabe',
  },
  imagei:{
    //marginLeft:"13.4%",
    width:22,
    height:22,
    // marginRight:"-20%"
  },
})
